import React from "react";
import { Link } from "react-router-dom";

class Logo extends React.Component {
  render() {
    return (
      <div>
        <Link to="/">
          <img
            style={{
              width: "200px",
              marginLeft: "20px",
              float: "left"
            }}
            src={require("./logosn.png")}
            alt="logo sneakerBis home"
          />
        </Link>
      </div>
    );
  }
}

export default Logo;
